export class Template{static Loading(){const n=document.createElement("template");n.setAttribute("id","js-template-loading"),n.innerHTML='\n      <style>\n        #loading{\n          position: fixed;\n          z-index: 9999;\n          width: 100vw;\n          height: 100vh;\n          display: flex;\n          align-items: center;\n          justify-content: center;\n        }\n        #loading svg {\n          width: 80px;\n          opacity: 0.5;\n        }\n      </style>\n      <section id="loading">\n        <svg with="80" height="80" version="1.1" id="L5" xmlns="http://www.w3.org/2000/svg"\n          xmlns:xlink="http://www.w3.org/1999/xlink" x="0px" y="0px" viewBox="0 0 100 100" enable-background="new 0 0 0 0"\n          xml:space="preserve">\n          <circle fill="#fff" stroke="none" cx="6" cy="50" r="6">\n            <animateTransform attributeName="transform" dur="1s" type="translate" values="0 15 ; 0 -15; 0 15"\n              repeatCount="indefinite" begin="0.1" />\n          </circle>\n          <circle fill="#fff" stroke="none" cx="30" cy="50" r="6">\n            <animateTransform attributeName="transform" dur="1s" type="translate" values="0 10 ; 0 -10; 0 10"\n              repeatCount="indefinite" begin="0.2" />\n          </circle>\n          <circle fill="#fff" stroke="none" cx="54" cy="50" r="6">\n            <animateTransform attributeName="transform" dur="1s" type="translate" values="0 5 ; 0 -5; 0 5"\n              repeatCount="indefinite" begin="0.3" />\n          </circle>\n        </svg>\n      </section>\n    ',document.body.appendChild(n)}render(n){switch(n){case"loading":Template.Loading();break;default:break}}}